import React, { useState } from 'react';
import './App.css';

const Counter = () => {
  const [count, setCount] = React.useState(0);

  return (
    <div>
      <button onClick={() => setCount(count + 1)}>
        Increase
      </button>
      <p> Number </p>
    </div>
  )
}

function App() {
  return (
    <div>
      <Counter>

      </Counter>
    </div>
  );
}

export default App
